// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract SocialDAO {
    uint256 csrDuration; // days for CSR to run (in days)
    uint256 milestoneDays; // number of milestones (split between csrDuration equally)
    uint256 nextMilestoneDate; // next date for milestone

    string metadataURI; // uri of metadata about the social game itself

    address beneficiary; // benefactor of the DAO and where the money should be approved

    mapping(address => uint256) approvers;

    // address vs how many percent of total tokens
    // important for disbursement of shares
    // when the milestone is cleared, we look allow regain
    // only those in this list can approve the milestones

    struct Milestone {
        string metadataURI; // uri of proof - updated when user wants to submit for approval
        uint256 milestoneDate; // when this milestone is expected to complete
        address[] approvers; // number of approvers; need at least 50%
    }

    Milestone[] milestonesApproved;
    Milestone currentMilestone;

    /**
     * calculate the next milestone. until milestone date is reached the next disbursement of funds
     * is not released.
     */
    function nextMilestone() private {
        require(nextMilestoneDate < csrDuration, "DAO has expired");
        require(
            nextMilestoneDate >= block.timestamp,
            "Cannot move to next milestone until milestone date is reached"
        );

        uint256 totalApprove;
        uint256 i;

        for (i = 0; i < currentMilestone.approvers.length; i++) {
            require(approvers[currentMilestone.approvers[i]] > 100, "Invalid Approval State");
            approvers[currentMilestone.approvers[i]] = approvers[currentMilestone.approvers[i]] - 1000;
            totalApprove += approvers[currentMilestone.approvers[i]];
        }

        require(
            totalApprove > 50,
            "Need more staked approvers, currently not enough approvers"
        );

        nextMilestoneDate = block.timestamp + milestoneDays * 1 days;
        if (nextMilestoneDate > csrDuration) {
            nextMilestoneDate = csrDuration;
        }

        Milestone memory nextMilestoneObj;
        currentMilestone = nextMilestoneObj;
        milestonesApproved.push(nextMilestoneObj);
    }

    constructor(
        uint256 duration,
        uint256 milestones,
        address[] memory approverList,
        uint256[] memory staked,
        address beneficiaryAddress,
        string memory metadata
    ) {
        // any requires here?

        require(milestones > 2 && milestones < 10, "Invalid Milestones");
        require(
            approverList.length > 2 &&
                approverList.length < 5 &&
                approverList.length == staked.length,
            "Approver/stake invalid"
        );
        require(duration > 90, "DAO Duration is invalid");

        uint256 i;

        csrDuration = block.timestamp + (duration * 1 days); // last day for this
        milestoneDays = duration / (milestones - 1);

        uint256 total = 0;

        for (i = 0; i < staked.length; i++) {
            approvers[approverList[i]] = staked[i];
            total += staked[i];
        }

        require(total == 100, "Insufficient staked tokens");

        nextMilestone();

        beneficiary = beneficiaryAddress;
        metadataURI = metadata;
    }

    function updateCurrentMilestoneMeta(string memory uri) public {
        require(
            currentMilestone.approvers.length == 0,
            "Milestone have been partially approved"
        );
        currentMilestone.metadataURI = uri;
    }

    function approveCurrentMilestone() public {
        // milestone metadata URI is not null!
        // caller only allowed if in approved list
        require(approvers[msg.sender] < 100, "Approver already approved this milestone");
        require(bytes(currentMilestone.metadataURI).length > 0, "Milestone URI not provided");

        approvers[msg.sender] = approvers[msg.sender] + 1000;
        currentMilestone.approvers.push(msg.sender); // prevent same person approving multiple times?
    }

    function getMilestoneURI() public view returns (string memory uri) {
        uri = currentMilestone.metadataURI;
    }
}
